import React from 'react';
import { Container } from 'react-bootstrap';

const Checkout = () => {
    return (
        <div className='check-out'>
            <Container>
                <h2>Please Checkout your booking</h2>
            </Container> 
        </div>
    );
};

export default Checkout;
